def parse_code_metadata(code_snippet: str) -> Tuple[int, int]:
    code_length = 1
    execution_time = 0
    lines = code_snippet.split('\n')
    for line in lines:
        if 'コード長' in line:
            code_length = int(line.split(':')[1].strip())
        elif '実行時間' in line:
            execution_time = int(line.split(':')[1].strip())
    return (code_length, execution_time)

